import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Container, Row, Col, Button, Alert, Breadcrumb, Card, Form } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import generateMainPage from "./Pages/MainPage";
import generateCategory from "./Pages/Category";
import {BrowserRouter as Router, Route, Routes } from "react-router-dom"

function App() {
  // return (
  //   generateMainPage()
  // )

  return(
    <Router>
      <Routes>
        <Route path = "/" element={<></>}/>
        <Route exact path = "/MainPage" component = {generateMainPage} />
        <Route exact path = "/Category" component = {generateCategory} />
      </Routes>
    </Router>
  )
}

export default App;
